import { Register } from '../components/Register';

export const LandingPage = () => {
	return (
		<div className="grid grid-cols-2 grid-rows-1 p-8 space-x-4" style={{height: ''}}>
			<div className="">
				<Login />
			</div>
			<div className="">
				<Register />
			</div>
		</div>
	);
};
